import requests
import lxml.html
import urllib
import sys
import json

def parsePrices(text):
    prevDelivTime = ""
    for element in lxml.html.fromstring(text).xpath("//td[@class='urgencyData to-right']"):
        text = element.text
        if text.find('RUR') >= 0:
            text = text.replace(',', '.')
            price = "".join(filter(lambda x: x.isdigit() or x == '.', text))
            print(json.dumps({ "price": price,
                        "time": prevDelivTime,
                        "condition": None,
                        }))

        elif text.find('дн') >= 0:
            prevDelivTime = text[:-4].replace(' ', '')
        else:
            prevDelivTime = ''
            
def getCity(text):
    r = requests.get("http://cse-cargo.ru/Scripts/Autocomplete.ashx?text=" + text + "&country=f2cd6487-4422-11dc-9497-0015170f8c09")
    r = lxml.html.fromstring(r.text).xpath("//li[@value='1']")[0]
    r = r.text_content()
    return { 'name': r.split('#')[0], 'id': r.split('#')[-1] }

def getDim(x):
    return int((float(x)**(1/3)) * 100)
def getVolumeWeight(x):
    return int(float(x) * (100 ** 3) / 6000)

